import { configureStore } from "@reduxjs/toolkit";

import popupReducer from "./popup/reducer";
import uReducer from "./user/reducer";

const store = configureStore({
  reducer: {
    popup: popupReducer,
    user: uReducer,
  },
});

export default store;
